--This is the final table produced from the downloaded and cleaned data after previous SQL queries have been performed

DROP TABLE IF EXISTS "tokyo_districts_table_final" CASCADE;

CREATE TABLE "tokyo_districts_table_final" (

"ogc_fid" SERIAL NOT NULL PRIMARY KEY  
"wkb_geometry" geometry,
"iso" VARCHAR(3),
"prefecture" VARCHAR(75),
"id" FLOAT8,
"name" VARCHAR(75),
"type_ja" VARCHAR(50),
"type_en" VARCHAR(50),
"name_ja" VARCHAR(75),
"numstores" NUMERIC(10,0),
"density" NUMERIC(10,0)
);

CREATE INDEX "tokyo_districts_table_final_wkb_geometry_geom_idx" ON "tokyo_districts_table_final" USING GIST ("wkb_geometry");


